import React from 'react'

function Watchprop( {Icon, tittle}) {
    return (
        <div style={{display:'flex',justifyContent:'space-around',alignItems:"center",height:"20px"}}>
            <Icon/>
            <h4>{tittle}</h4>
        </div>
    )
}

export default Watchprop
